class HttpServer
{
    public static HttpListener? listener;
    public static string url = "http://localhost:8000/";
    public static int pageViews = 0;
    public static int requestCount = 0;
    public static string pageData =
        "<!DOCTYPE>" +
        "<html>" +
        "  <head>" +
        "    <title>HttpListener Example</title>" +
        "  </head>" +
        "  <body>" +
        "    <p>Page Views: {0}</p>" +
        "    <form method=\"post\" action=\"shutdown\">" +
        "      <input type=\"submit\" value=\"Shutdown\" {1}>" +
        "    </form>" +
        "  </body>" +
        "</html>";

    public static string GetRealAssemblyName(string name)
    {
        string? newName = "";

        int ix;
        for (ix = 0; ix < name.Length; ix++)
        {
            if (name[ix] == ' ')
                newName += '_';
            else
                newName += name[ix];
        }

        return newName;
    }
    public static Stream GetResourceFile(string rscName)
    {
        if( rscName.StartsWith("/"))
        {
            rscName = rscName.Substring(1, rscName.Length - 1);
        }
        // Erhalten Sie den Assembly-Namen
        string? assemblyName = GetRealAssemblyName(Assembly.GetExecutingAssembly().GetName().Name!);

        // Erstellen Sie den vollständigen Ressourcennamen
        string? resourceName = $"{assemblyName}.{rscName}";
        string? resourceName2 = $"{assemblyName}.Resources.Raw.{rscName}";

        // var x = Assembly.GetExecutingAssembly().GetManifestResourceNames();
        // var y = Assembly.GetEntryAssembly()!.GetManifestResourceNames();

        // Öffnen Sie die Ressource als Stream
        Stream currentStream = Assembly.GetExecutingAssembly().GetManifestResourceStream(resourceName)!;
        if (currentStream == null)
            currentStream = Assembly.GetExecutingAssembly().GetManifestResourceStream(resourceName2)!;
        if (currentStream == null)
            currentStream = Assembly.GetExecutingAssembly().GetManifestResourceStream(rscName)!;

        // Geben Sie den Stream zurück
        return currentStream;
    }

    public static async Task HandleIncomingConnections()
    {
        bool runServer = true;

        // While a user hasn't visited the `shutdown` url, keep on handling requests
        while (runServer)
        {
            // Will wait here until we hear from a connection
            HttpListenerContext ctx = await listener!.GetContextAsync();

            // Peel out the requests and response objects
            HttpListenerRequest req = ctx.Request;
            HttpListenerResponse resp = ctx.Response;

            // Print out some info about the request
            /*
            Console.WriteLine("Request #: {0}", ++requestCount);
            Console.WriteLine(req.Url?.ToString());
            Console.WriteLine(req.HttpMethod);
            Console.WriteLine(req.UserHostName);
            Console.WriteLine(req.UserAgent);
            Console.WriteLine();
            */

            // If `shutdown` url requested w/ POST, then shutdown the server after serving the page
            if ((req.HttpMethod == "POST") && (req.Url!.AbsolutePath == "/shutdown"))
            {
                Console.WriteLine("Shutdown requested");
                runServer = false;
            }

            // Make sure we don't increment the page views counter if `favicon.ico` is requested
            if (req.Url!.AbsolutePath != "/favicon.ico")
                pageViews += 1;


            byte[] data;
            if (req.RawUrl!.EndsWith(".jpg"))
            {
                Stream s = GetResourceFile(req.RawUrl);

#if IOS || ANDROID || MACCATALYST
                // PlatformImage wird derzeit nicht auf Windows unterstützt.
                // return PlatformImage.FromStream(stream);
                  string disableSubmit = !runServer ? "disabled" : "";
              data = Encoding.UTF8.GetBytes(String.Format(pageData, pageViews, disableSubmit));
#elif WINDOWS
                using (MemoryStream ms = new MemoryStream())
                {
                    s.CopyTo(ms);
                    data = ms.ToArray();
                }
                // data = StreamToByteArray(s);
                // IImage i = PlatformImage.FromStream(s);

                // string disableSubmit = !runServer ? "disabled" : "";
                // data = Encoding.UTF8.GetBytes(String.Format(pageData, pageViews, disableSubmit));
#endif
                if (s != null)
                {
                    // data = Encoding
                    resp.ContentType = "image/jpeg";
                    resp.ContentEncoding = Encoding.Default;
                    resp.ContentLength64 = data.LongLength;
                }
                s!.Close();
                s!.Dispose();
            }
            else
            {
                // Write the response info
                string disableSubmit = !runServer ? "disabled" : "";
                data = Encoding.UTF8.GetBytes(String.Format(pageData, pageViews, disableSubmit));
                resp.ContentType = "text/html";
                resp.ContentEncoding = Encoding.UTF8;
                resp.ContentLength64 = data.LongLength;
            }
            // Write out to the response stream (asynchronously), then close it
            await resp.OutputStream.WriteAsync(data, 0, data.Length);
            resp.Close();
        }
    }

    public void StartListening()
    {
        listener = new HttpListener();
        listener.Prefixes.Add(url);
#if WINDOWS
        listener.Start();
#endif
        Task listenTask = HttpServer.HandleIncomingConnections();
        // listenTask.GetAwaiter().GetResult();
        
    }

}

