    public GlobalSpecs( IDeviceData DeviceData )
    {
        _globalData = new();
        _globalData.LayoutDescription.ScreenMode = IGlobalData.screenMode.portrait;
        _currentGlobalSpecs = this;
        if (GlobalSpecs.CurrentGlobalSpecs!.GetScreenWidth() > GlobalSpecs.CurrentGlobalSpecs.GetScreenHeight())
        {
            GlobalData.CurrentGlobalData!.LayoutDescription.ScreenMode = IGlobalData.screenMode.landscape;
        }


        // ToDo: Entfernen bitte!

        ReloadThemeInfo();
        ReloadFontInfo();
        ReloadFontSizeInfo();
        ReloadReplayInfo();

        _currentTheme = _themeInfo![3]!;
        _currentFont = _fontInfo![1]!;
        _currentFontSize = _fontSizeInfo![2]!;
        _currentReplayInfo = _replayInfo![0]!;

         GlobalData.CurrentGlobalData!.SetHtmlFromTheme();
        SetCurrentTheme(_currentTheme);
        AppShell._mainAppShell!.ChangeTheme(new Resources.Styles.ThemeD());


        AppRunning = IGlobalSpecs.appRunning.start;
    }

