        else
            return DeviceDisplay.Current.MainDisplayInfo.Height / DeviceDisplay.Current.MainDisplayInfo.Density;
#else
        if (CurrentContentPage != null)
            return CurrentContentPage.Height;
        else if (App.MainWindow != null)
        {

            return App.MainWindow.Height - 35 ;
        }
        else
            return (0);
#endif
    }
    public ILayoutDescription.eClickMargin GetClickMargin()
    {
        return GlobalData.CurrentGlobalData!.LayoutDescription.ClickMargin;
