    public double GetClickMarginPixel()
    {
        ILayoutDescription.eClickMargin cm = GlobalData.CurrentGlobalData!.LayoutDescription.ClickMargin;

        if (cm == ILayoutDescription.eClickMargin.very_low)
            return 0;
        else if (cm == ILayoutDescription.eClickMargin.low)
            return 2;
        else if (cm == ILayoutDescription.eClickMargin.medium)
            return 4;
        else if (cm == ILayoutDescription.eClickMargin.high)
            return 8;
        else if (cm == ILayoutDescription.eClickMargin.very_high)
            return 12;
        else
            return 0;
    }

