public class Version
{

    private int _version1;

    private int _version2;

    private int _version3;

    private DateTime _versionDate;



    public Version(int v1, int v2, int v3, int day, int month, int year)
    {
        this.Version1 = v1;
        this.Version2 = v2;
        this.Version3 = v3;
        this.VersionDate = new DateTime(year, month, day);
    }

    public Version()
    {
        this.Version1 = 1;
        this.Version2 = 2;
        this.Version3 = 0;
        this.VersionDate = new DateTime(2024, 04, 28);
    }

