    {
        bool upToDate = true;

        if (v.Version1 < this.Version1)
            upToDate = false;
        else if (v.Version2 < this.Version2)
            upToDate = false;
        else if (v.Version3 < this.Version3)
            upToDate = false;

        return upToDate;
    }

